import styled from "styled-components";

const Title = styled.h1`
    font-weight: 700;
    text-align: center;
    text-transform: uppercase;
`

function MainSecTileCTA(){
    return <Title>¿A qué esperas? ¡Elige tu regalo!</Title>
}

export default MainSecTileCTA
